import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

import './Shop.css'; // Ensure this path matches your project structure

function Shop() {
  const [products, setProducts] = useState([]);
  const [popup, setPopup] = useState({ visible: false, message: '', loginButton: false });

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await axios.post("http://localhost:8009/api/productList");
        setProducts(response.data.data); // Assuming response.data.data contains the array of products
      } catch (error) {
        console.log('Error fetching products:', error);
      }
    };

    fetchProducts();
  }, []);

  const userId = sessionStorage.getItem("userId");

  const addToCart = async (item) => {
    if (!userId) {
      setPopup({
        visible: true,
        message: 'You have to login first. Click here to login.',
        loginButton: true
      });
      setTimeout(() => {
        setPopup({ visible: false, message: '', loginButton: false });
      }, 4000); // Hide popup after 6 seconds
      return;
    }
    
    const existingProduct=products.find(product=>product._id===item._id)
    if(existingProduct){
      setPopup({
        visible: true,
        message: 'Product already exists in cart',
      })
      setTimeout(()=>{
        setPopup({visible:false,message:''})
      },3000)
    }

    const data = {
      userId: userId,
      productId: item._id,
      quantity: 1 // Initial quantity
    };

    try {
      const response = await axios.post("http://localhost:8009/api/addCartList", data);
      console.log(response.data);
      setPopup({ visible: true, message: `${item.title} has been added to cart` });
      setTimeout(() => {
        setPopup({ visible: false, message: '', loginButton: false });
      }, 3000); // Hide popup after 3 seconds
      // Optionally update the cart state or show a success message
    } catch (error) {
      console.log('Error adding to cart:', error);
    }
  };

  return (
    <>
      <section className="shop_section layout_padding">
        <div className="container">
          <div className="heading_container heading_center">
            <h2>Latest Products</h2>
          </div>
          <div className="row">
            {products.map((product) => (
              <div className="col-sm-6 col-md-4 col-lg-6" key={product._id}>
                <div className="box">
                  <a href="#">
                    <div className="img-box">
                      <img src={product.url} alt={product.title} />
                    </div>
                    <div className="detail-box">
                      <h6>{product.title}</h6>
                      <p>{product.description}</p>
                      <h6>
                        Price <span>${product.price}</span>
                      </h6>
                      <p>Category: {product.category}</p>
                      <button onClick={() => addToCart(product)}>Add to Cart</button>
                    </div>
                    <div className="new">
                      <span>New</span>
                    </div>
                  </a>
                </div>
              </div>
            ))}
          </div>
          <div className="btn-box">
            <a href="#">View All Products</a>
          </div>
        </div>
      </section>
      {popup.visible && (
        <div className="popup">
          <p>{popup.message}</p>
          {popup.loginButton && (
            <Link to="/login">
              <button className="login-button">Login</button>
            </Link>
          )}
        </div>
      )}
      <section className="info_section  layout_padding2-top">
        <div className="social_container">
          <div className="social_box">
            <a href="">
              <i className="fa fa-facebook" aria-hidden="true" />
            </a>
            <a href="">
              <i className="fa fa-twitter" aria-hidden="true" />
            </a>
            <a href="">
              <i className="fa fa-instagram" aria-hidden="true" />
            </a>
            <a href="">
              <i className="fa fa-youtube" aria-hidden="true" />
            </a>
          </div>
        </div>
        <div className="info_container ">
          <div className="container">
            <div className="row">
              <div className="col-md-6 col-lg-3">
                <h6>ABOUT US</h6>
                <p>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                  doLorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                  doLorem ipsum dolor sit amet,
                </p>
              </div>
              <div className="col-md-6 col-lg-3">
                <div className="info_form ">
                  <h5>Newsletter</h5>
                  <form action="#">
                    <input type="email" placeholder="Enter your email" />
                    <button>Subscribe</button>
                  </form>
                </div>
              </div>
              <div className="col-md-6 col-lg-3">
                <h6>NEED HELP</h6>
                <p>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                  doLorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                  doLorem ipsum dolor sit amet,
                </p>
              </div>
              <div className="col-md-6 col-lg-3">
                <h6>CONTACT US</h6>
                <div className="info_link-box">
                  <a href="">
                    <i className="fa fa-map-marker" aria-hidden="true" />
                    <span> Gb road 123 london Uk </span>
                  </a>
                  <a href="">
                    <i className="fa fa-phone" aria-hidden="true" />
                    <span>+01 12345678901</span>
                  </a>
                  <a href="">
                    <i className="fa fa-envelope" aria-hidden="true" />
                    <span> demo@gmail.com</span>
                  </a>
                </div>
              </div>
            </div>
          </div>
        </div>
        {/* footer section */}
        <footer className=" footer_section">
          <div className="container">
            <p>
              © <span id="displayYear" /> All Rights Reserved By
              <a href="https://html.design/">Free Html Templates</a>
            </p>
          </div>
        </footer>
        {/* footer section */}
      </section>
    </>
  );
}

export default Shop;
